import React from 'react';
import './EditInfo.css';

const EditInfo=()=>{
    console.log("Edit Info rendered");
    return(
        <div>
            <div>
                <h1>Edit Student Information</h1>
                <label>Last Name</label>
                <input id="lastname"></input>

            </div>
        </div>
    )
}

export default EditInfo;
